body {
  font-family: Arial, sans-serif;
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  margin: 0;
}

.profile-picture-widget {
  text-align: center;
}

.profile-picture-container {
  position: relative;
  display: inline-block;
}

.profile-picture {
  width: 100px;
  height: 100px;
  border-radius: 50%;
  object-fit: cover;
  cursor: pointer;
  /* Remove border and background color */
}

.file-input {
  display: none;
}

.upload-button {
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
  cursor: pointer;
}

.icon {
  position: absolute;
  bottom: 10px;
  right: 10px;
  width: 24px;
  height: 24px;
  opacity: 0.8;
  transition: opacity 0.3s ease;
}

.upload-button:hover .icon {
  opacity: 1;
}

.profile-picture[src="upload-icon.png"] + .upload-button .edit-icon {
  display: none;
}

.profile-picture:not([src="upload-icon.png"]) + .upload-button .edit-icon {
  display: block;
}

.upload-text {
  text-align: center;
  margin-top: 10px;
  font-size: 1rem; /* Set font size to 1rem */
  color: #333;
  font-weight: bold; /* Make text bold */
}

