appsmith.onReady(() => {
  const fileInput = document.getElementById('fileInput');
  const profilePicture = document.getElementById('profilePicture');
  const uploadIcon = 'data:image/png;base64,'; // Path to the upload icon

  // Function to set the initial image or upload icon
  const setInitialImage = () => {
    const initialImage = appsmith.model.image;
    if (initialImage && initialImage !== "undefined") {
      profilePicture.src = initialImage;
    } else {
      profilePicture.src = uploadIcon; // Show upload icon if no initialImage
    }
  };

  // Initialize profile picture
  setInitialImage();

  // File input change event listener
  fileInput.addEventListener('change', function (event) {
    const file = event.target.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onload = function (e) {
        profilePicture.src = e.target.result;
        appsmith.updateModel({
          image: e.target.result
        });
      };
      reader.readAsDataURL(file);
    }
  });

  // Polling function to check for updates
  const pollForUpdates = () => {
    setInterval(() => {
      const latestImage = appsmith.model.image;
      // Check if latestImage is defined and different from the current src
      if (latestImage && latestImage !== profilePicture.src && latestImage !== "undefined") {
        profilePicture.src = latestImage;
      } else if (!latestImage || latestImage === "undefined") {
        profilePicture.src = uploadIcon; // Revert to upload icon if image is undefined
      }
    }, 500); // Poll every 500ms
  };

  // Start polling
  pollForUpdates();
});

